★商品説明★
TIMBERLAND「ティンバーランド」からROLL TOP BOOTS「ロールトップ」
TB06635A ブラックヌバックカラーが入荷！折りたたんだ状態と
ハイカットの６インチブーツの２WAYで履ける大人気ブーツです。
本来、アウトドア用のブーツですのでもちろん履き心地も抜群です！
ストリート、カジュアルや、HIPHOPスタイル、きれいめスタイルまで
幅広く使える便利なアイテム！。<table width="100%" cellspacing="2" cellpadding="0" border="0">
