★商品説明★
TIMBERLAND「ティンバーランド」のChukka Boots TB050061が待望の入荷！！
シンプルなデザインでカジュアルなスタイルからストリート系、
HIP HOP系すべてのスタイルにマッチするデザインです！！。
もちろん季節関係なくオールシーズン愛用できます。売切れる前にぜひ！！。ご提供！<table width="100%" cellspacing="2" cellpadding="0" border="0">
