■商品説明■<br>

ダナーライトシリーズより海外限定！日本未発売モデル DANNER LIGHT「ダナーライト」<br>
#30434 ベッケル キャンバス＆ヌバック グレーが新入荷！50年もの間オレゴン州・ポート<br>
ランドでキャンバス生地のテントを制作してきた、Beckel Canvas社とダナー社の共同開発<br>
モデルになります。大人気のダナーライトがベースになっています。10オンスのキャンバス<br>
クォーターパネル、ヌバックレザー、ブーツを快適に保つことのできるDri-Lexライニングにより、<br>
作成されています。衝撃を吸収材であるグラスファイバーシャンクも搭載し、ビブラムGumlite<br>
アウトソールになっています。限定のため、少量生産の激レアモデルとなっています。<table width="100%" cellspacing="2" cellpadding="0" border="0">
<tr>
