■商品説明■<br>
ダナーシリーズより限定モデル！ DANNER MOUNTAIN LIGHT #30866が新入荷！<br>
ダークなブラウンカラーで、つるっとしたレザーを採用！！<br>
本体にはゴアテックス・ブーティー「防水皮膜」加工がなされており、<br>
それでいてキャンブレル仕様で通気性も確保されています！！<br>
さらにフルグレインレザーのワンピース構造で丈夫さと風合いの両立がなされています！！<br>
アッパー部分はコーデュラナイロンにスムースレザーの補強でタフな作りです！<br>
好みによって装着できる 
"Danner Patented Airthotic" インステップクッション付き！<table width="100%" cellspacing="2" cellpadding="0" border="0">
